 if(start==p1):
  start=0
 else:
  start=1
 n=int(temp[0])

 l=[]
 for i in range(n):
  s=input()
  s=list(s)[::-1] #stack
  s=[int(x) for x in s]
  l.append(s)




 while True:
  finished=False
  for s in l:
   done=False
   if(s): 
    if(s[-1]==start):
     s.pop() 
     done=True
     finished=True
    else:
     continue

   while(s): #playing optimally and taking control of the stack by                 removing other player's elements
    if(s[-1]!=start):
     s.pop() 
     done=True
     finished=True
    else:
     break
   if(done):
    break

  if(not finished):
   break
  start=1-start

 if(start==0):
  print("Dum") #whoever couldn't finish, loses in this problem
 else:
  print("Dee")


